        	values.put("psicotest.question1.text", "एक बार में, अगर वेटर / वेट्रेस नहीं आता है जब मैं उसे पास बुलाता हूं, या अगर खाना वो नहीं है जो मैंने ऑर्डर किया है");
        	values.put("psicotest.question25.text", "अगर कोई कुछ समझ नहीं सकता है, जो मैं समझाने की कोशिश कर रहा हूं तो");
