        	values.put("psicotest.question16.text", "अगर मैं एक ऐसी गतिविधि शुरू करता हूं जो अनिवार्य नहीं है (जैसे कि जिम जाना, कोर्स करना या इलाज कराना) और मैं आम तौर पर जल्दी से गंभीरता छोड़ देता हूँ");
        	values.put("psicotest.question13.text", "अगर मैं एक कमरे में चला गया, और वहां के लोग हंस रहे हैं, मुझे आश्चर्य है कि क्या मेरे बारे में कुछ अजीब है या अगर वे मुझ पर हंस रहे हैं");
        	values.put("psicotest.question6.text", "अगर मैं एक हिंसक व्यक्ति को देखता हूं जो किसी अन्य पर हमला करने वाला है, मैं अपने आप को चोट नहीं पहुंचाने के लिए रक्षा करता हूं");
        	values.put("psicotest.question12.text", "अगर मैं किसी व्यक्ति, सिद्धांत या विचारधारा का सक्रिय समर्थन करता हूं और कोई व्यक्ति इस पर सवाल उठाता है");
        	values.put("psicotest.question22.text", "अगर मैं खाने के लिए या फिल्मों में जाने की सोच रहा हूं");
        	values.put("psicotest.question3.text", "अगर मैं खून और चोटों के साथ एक भयानक दुर्घटना देखता हूं");
        	values.put("psicotest.question9.text", "अगर मैंने किसी से मिलने की व्यवस्था की है और यह व्यक्ति समय पर नहीं है, पहली बात यह है कि मन में आता है");
        	values.put("psicotest.question30.text", "अगर, किसी शॉपिंग स्टोर या मॉल में, मुझे कुछ दिखाई देता है, जिसमें मुझे दिलचस्पी है");
        	values.put("psicotest.question8.text", "एक सामाजिक सभा या पार्टी में एक विवादास्पद विषय पर चर्चा करते समय");
        	values.put("psicotest.question28.text", "ऐसी बहुत सी बातें/ चीजें है, उस के बारे में सोच भी मुझे घृणित महसूस करती हैं ");
        	values.put("psicotest.question33.text", "कभी-कभी मैं देखता हूं कि जब मैं किसी पार्टी में पहुंचता हूं और मेरे पास आने पर अन्य लोग विषय बदल देता है, या तो लोग कानाफूसी करने लगते हैं");
        	values.put("psicotest.question21.text", "कुछ असुविधाजनक परिस्थितियाँ जैसे कि चाबियों का गलत स्थान पर होना, लाइन में प्रतीक्षा या यातायात में फंसना, वास्तव में मुझे गुस्सा दिलाता है");
        	values.put("psicotest.question32.text", "कुछ सोच या विचार पर चर्चा करते समय, मैं आमतौर पर");
        	values.put("psicotest.question7.text", "जब एक बोर्ड गेम खेल रहे हों (जैसे एक चेकर्स)");
        	values.put("psicotest.question2.text", "जब मुझे किसी स्टोर या कार्यालय में उपस्थित होने के लिए इंतजार करने की आवश्यकता होती है,मैं चिंतित या अधीर महसूस करता हूं क्योंकि मैं अपने काम पर वापस जाना चाहता हूं");
        	values.put("psicotest.question44.text", "जब मुझे कोई चीज़ दिखाई देती है, तो (जैसे पत्रिका, सीडी, भोजन, आदि)");
        	values.put("psicotest.question19.text", "जब मुझे दिन के लिए आमंत्रित किया जाता है, तो मैं अपना समय विचार करने के लिए निकालता हूं कि क्या यह वास्तव में चलने लायक है");
        	values.put("psicotest.question42.text", "जब मैं एक लंबी व्याख्या सुनता हूं, तो मैं उस व्यक्ति से सीधे और सरल बात करने के लिए कहता हूं");
        	values.put("psicotest.question35.text", "जब मैं एक लोगों से भरा लिफ्ट, या बस के अंदर होता हूं तो तनाव महसूस करता हूं (इसके बावजूद मैं अभी भी इस पर पहुंचने का प्रबंधन करता हूं)");
        	values.put("psicotest.question39.text", "जब मैं किसी को कुछ करने के लिए कहता हूं और वे ऐसा नहीं करते हैं (उदाहरण के लिए, मुझे कुछ देने के लिए, टीवी को बंद करें,  या चलाएं)");
        	values.put("psicotest.question41.text", "जब मैं किसी पार्टी या मीटिंग के लिए तैयार होता हूं,मुझे अपना आउटफिट चुनने में समय लगता है, भले ही मुझे इसे कई बार बदलना पड़े");
        	values.put("psicotest.question4.text", "जब मैं किसी से तुच्छ काम करने के लिए कहता हूं जैसे कि एक जूता मेंशन होना, फोटोकॉपी लिया जाना, फोटो विकसित होना आदि), और काम पूरा हो गया है, लेकिन ठीक से नहीं");
        	values.put("psicotest.question38.text", "जब मैं किसी से पूछता हूं कि क्या वे किसी बात से सहमत हैं");
        	values.put("psicotest.question15.text", "जब मैं किसी से मिलता हूं, तो मैं तुरंत उनकी एक राय बनाता हूं: मैं बता सकता हूं कि वे वास्तविक हैं या नकली, बुद्धिमान हैं या बहुत उज्ज्वल नहीं हैं, आदि।");
        	values.put("psicotest.question34.text", "जब मैं जूते या कपड़े की खरीदारी के लिए जाता हूं और मुझे सबसे पहली चीज पसंद आती है");
