        	values.put("module1789.question23966.text", "اگر آپ شراب پی کر ایک گھنٹے تک انتظار کرتے ہیں تاکہ موٹر سائیکل سواری سے پہلے اس کے اثرات/نشہ، آپکے جسم سے ختم ہو جائے تو۔۔۔۔۔۔۔");
        	values.put("module1789.question23967.text", "موٹر سائیکل کی فرنٹ بریکس موٹر سائیکل روکنے کے لیے کتنی قوت رکھتی ہیں؟");
        	values.put("module1789.question23968.text", "اگر دوران سفر، آپ کے موٹر سائیکل کا ٹائر پنکچر/برسٹ ہو جائے تو آپ کو لازما یہ کرنا چاہئے۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("module1789.question23969.text", "اگر آپ کسی ایسے چوراہے پر پہنچتے ہیں جہاں کی ٹریفک کنٹرول نہیں کی جا رہی اور آپ ایک راہ گیر کو دیکھتےہیں جو چوراہے پر پہنچ جاتا ہے، تو آپ کو لازما کرنا ہو گا۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("module1789.question23970.text", "سڑک پر لین تبدیل کرنے سےپہلے ، سب سے اہم کام جو آپ کو کرنا ہے۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("module1789.question23971.text", "سرک پر لین تبدیل کرنے سے پہلے، دائیں یا بائیں طرف دیکھنے کی اہمیت اس لیے ہے کیونکہ یہ جاننا ضروری ہے کہ۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
