        	values.put("psicotest.question1.text", "ایک شراب خانے میں، جب میں بلائوں اور ویٹر یا ویٹرس نہ آئے یا جب میں آرڈر کروں تو کھانا نہ آئے۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question2.text", "جب مجھے کسی سٹور یا آفس میں انتظار کرایا جائے تو میں بے چین ہو جاتا ہوں کیونکہ میں واپس اپنے کام کاج کی طرف پلٹنا چاہتا ہوں؟");
        	values.put("psicotest.question3.text", "اگر میں کسی سنگین حادثے میں خون اور زخموں کو دیکھوں تو میرا ردعمل ہو گا؟");
        	values.put("psicotest.question4.text", "جب میں کسی کو کوئی معمولی کام کرنے کا کہوں جیسے فوٹوکاپی کرنا، اور کام کیا تو جائے مگر صحیح طریقے سے نہ ہو تو۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question5.text", "میں ہمیشہ لوگوں کے رویے کو جانچنے کے حوالے سے شک و شبہ میں رہتا ہوں کیونکہ میں پر یقین نہیں ہوتا کہ وہ کام کو صحیح طرح کر رہے ہوتے ہیں۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question6.text", "جب میں کسی شخص کو تشدد پر آمادہ دیکھتا ہوں تو میں اپنے آپ کو کسی قسم کی چوٹ سے بچانے کے لیے محفوظ کرتا ہوں۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question7.text", "جب میں ایک بورڈ گیم کھیلتا ہوں جیسا کہ شطرنج وغیرہ۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question8.text", "جب کسی سماجی تقریب میں کسی متنازعہ موضوع پر بحث ہو تو۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question9.text", "اگر میں نے کسی سے ملنا طے کیا ہے اور وہ شخص وقت پر نہیں آیا تو جو پہلی چیز میری سوچ میں آتی ہے ۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question10.text", "میں فیصلہ کرنے کے لیے آخری لمحہ کا انتظار کرتا ہوں کہ میں کیا کر رہا ہوں (جیسے کسی کو دعوت دینا، کہیں جانا یا کوئی راستہ اختیار کرنا، بالفرض میں اگر اپنا ذہن تبدیل کرتا ہوں)۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question11.text", "جب میں ہوائی سفر اختیار کرتا ہوں تو میں فکر مند اور پریشان ہوتا ہوں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question12.text", "اگر میں کسی شخص کی بھرپور مدد کرتا ہوں اور کوئی شخص اس بارے  یا نظریہ سوال پوچھے۔۔۔۔۔۔۔");
        	values.put("psicotest.question13.text", "جب میں کسی کمرے میں داخل ہوتا ہوں اور لوگ مجھے دیکھ کر ہنستے ہیں تو میں حیران ہوتا ہوں کہ آیا میرے حوالے سے کوئی مزاح دار بات ہے یا وہ صرف مجھ پر ہی ہنس رہے ہیں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question14.text", "جب کوئی نو عمر شخص کام یا پڑھائی نہیں کرتا تو اس کے کسی آسان راستہ کا انتخاب کرنے کے امکانات زیادہ ہیں اور کسی دوسرے کے ، اس حوالے سے ، اس نو عمر شخص کے ساتھ زیادہ سخت برتائو رکھنے کے امکانات زیادہ ہوتے ہیں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question15.text", "جب میں کسی سے پہلی دفعہ ملتا ہوں تو فورا ان کے بارے میں رائے قائم کر لیتا ہوں ۔ میں بتا سکتا ہوں کہ وہ خالص ہیں یا جعلی ۔ زہین ہیں یا بہت اعلٰی / عمدہ ہیں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question16.text", "اگر میں کوئی ایسا کام شروع کروں جو کہ ضروری نہ ہو جیسے (ورزش کے لیے جم میں جانا، یا کسی بیماری سے شفا پانے  کے لیے علاج وغیرہ کروانا) تو میں فورا اپنی دلچسپی کھو بیٹھتا ہوں۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question17.text", "اگر کوئی مجھ سے گستاخی سے بات کرے یا غیر شائستہ طریقے سے پیش آئے تو۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question18.text", "جب کوئی شخص میرے ساتھ گفتگو کے دوران بدتمیزی یا غیر شائستگی کا مظاہرہ کرتا ہے تو۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question19.text", "جب مجھے پورے دن کے لیے باہر جانے کی دعوت دی جائے تو میں اس بات پر غور کرنے کے لیے وقت لیتا ہوں کہ یہ میرے لیے کیا فائدہ/ قیمت رکھتی ہے۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question20.text", "میں شائستگی اور اچھےاطوار کو زیادہ اہمیت دیتا ہوں بہ نسبت دوسرے لوگوں کے۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question21.text", "بعض یقینی دشواریاں، جیسا کہ چابیوں کا گم ہو جانا لائن میں لگ کر کھڑا ہونا، یا ٹریفک جام میں پھنسنا میرے اعصاب پر اثر ڈالتا ہے۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question22.text", "اگر میں باہر کھانا کھانے یا فلم، دیکھنے کے لیے سوچ رہا ہوتا ہوں تو۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question23.text", "میں ایسے امیر لوگوں کو پسند کرتا ہوں جوآزاد خیالی بے احتیاطی اور موجودہ حال میں رہتے ہیں، اگرچہ وہ کوئی زیادہ نظم و ضبط سے نہیں رہتے۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question24.text", "میں بلندی پر نیچے دیکھ سکتا ہوں بغیر اس خوف کہ میں یہاں سے گر پڑوں گا۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question25.text", "جب کوئی شخص یہ جان نہ پائے کہ کچھ، کس طرح وقوع پزیر ہوا ہے۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question26.text", "جب کوئی فلم دیکھتے ہوئے یا کوئی کتاب / مضمون پڑھتے وقت۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question27.text", "اگر میں کسی پارٹی میں کسی ایسے شناسا کو دیکھتا ہوں جو مجھ سے دور ہو مجھے دیکھ کر رخ پھیر لے تو جو پہلی چیز ، میں سوچتا ہوں کہ۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question28.text", "بہت ساری چیزیں مجھے بیمار یا حقارت پیدا کرتی ہیں، میں جتنا ان کے بار میں سوچوں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question29.text", "میں ماہر لوگوں کی درجہ بندی کر سکتا ہوں کہ یہ اہل ہیں یا نا اہل۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question30.text", "اگر میں کسی سٹور یا مارکیٹ میں ، کسی چیز میں دلچسپی لیتا ہوں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question31.text", "میں یقین رکھتا ہوں کہ بہت سارے لوگ اپنا کام کرنے میں ناکام ہو جاتے ہیں کیونکہ انمیں صلاحیت کی کمی یا ذمہ داری کا فقدان ہوتا ہے۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question32.text", "جب کوئی نئے خیال پر بحث ہو رہی ہو تو میں عام طور پر۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question33.text", "میں یہ محسوس کرتا ہوں کہ جب میں کسی تقریب میں جاتا ہوں تو لوگ میرے متعلق سرگوشیاں شروع کر دیتے ہیں یا موضوع کو تبدیل کر دیتے ہیں جب میں ان کے نزدیک پہنچا ہوں۔۔۔۔۔۔۔۔۔۔۔۔");
        	values.put("psicotest.question34.text", "جب میں جوتوں اور کپڑوں کی خریداری کےلیے باہر جاتا ہوں اور جب میں کوئی چیز پسند کرتا ہوں۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔۔");
